import React from 'react';

export default class Search extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  }

  render() {
    return <div className='searc'>
      <div>
        <div>
          <span className="left"></span >
          <span className="right"></span >
        </div>
        <div>
          <input type='text' value='' placeholder='搜索' />
        </div>
      </div>

    </div>
  }
}
